INSERT INTO `products` (`id`, `category_id`, `sku`, `name`, `descript`, `picture_name`, `price`, `current_discount`, `stock`, `product_unit`, `is_available`, `add_date`) VALUES
(41, 17, 'NKK6100448', 'Nastar', 'Nastar adalah kue kering dari adonan tepung terigu, mentega, dan telur yang diisi dengan selai nanas, cokelat, maupun rasa lainnya.', 'nastar.jpg', 60000, 0.00, 100, '1 toples', 1, '2023-11-29 06:40:48'),
(42, 17, 'GKK510441', 'Goodtime', 'Biskuit Goodtime adalah camilan yang lezat dan menyenangkan. Mereka seringkali memiliki tekstur renyah dan rasa yang menggugah selera. Biskuit Goodtime bisa datang dalam berbagai bentuk dan varian, mulai dari biskuit cokelat yang lezat hingga biskuit vanilla yang ringan', 'goodtime.jpg', 50000, 0.00, 10, '1 Toples', 1, '2023-11-30 07:57:21'),
(43, 19, 'DGKB315082', 'Dadar Gulung', 'Dadar gulung adalah hidangan yang lezat dan seringkali merupakan camilan atau hidangan penutup yang populer di berbagai budaya. Biasanya terbuat dari adonan yang terdiri dari tepung beras atau tepung terigu, telur, santan, gula, dan sedikit garam. Adonan ini kemudian dibuat tipis dan digoreng tipis di atas penggorengan datar.', 'dadargulung.jpg', 3000, 0.00, 15, '1 pcs', 1, '2023-11-30 08:24:42'),
(44, 20, 'SCKUT13214', 'Strawberry Cake', 'Kue ulang tahun dengan rasa strawberry adalah kreasi yang menyegarkan dan manis. Biasanya, kue ini terdiri dari lapisan-lapisan kue lembut yang diisi dengan selai atau krim beraroma strawberry. Bagian luar kue sering kali dilapisi dengan frosting atau krim berwarna merah muda yang cantik untuk menambahkan sentuhan yang menyenangkan.', 'strawberrycake.jpg', 100000, 0.00, 3, '1 pcs', 1, '2023-11-30 08:26:54'),
(45, 21, 'DDR210424', 'Dunkin Donut', 'Donat dunkin adalah camilan manis yang terdiri dari adonan berbentuk bulat yang digoreng hingga kecokelatan dan kemudian dilapisi dengan gula. Biasanya, setelah donat digoreng hingga matang dan masih hangat, mereka dicelupkan atau digulingkan dalam gula halus atau gula kasar sehingga terbentuk lapisan gula yang memberikan rasa manis dan tekstur yang renyah.', 'donat.jpg', 2500, 0.00, 10, '1 pcs', 1, '2023-11-30 08:30:24'),
(46, 19, 'PKB320638', 'Paybro', 'Brownies coklat adalah sejenis kue yang khas dengan tekstur padat namun lembut, dan rasa yang kaya akan cokelat. Biasanya berwarna coklat gelap hingga kemerahan karena kandungan cokelat dalam adonannya. Brownies terbuat dari bahan-bahan seperti cokelat, mentega, gula, telur, dan tepung terigu', 'paybro.jpg', 3000, 0.00, 20, '1 pcs', 1, '2023-11-30 08:33:58'),
(47, 20, 'CCCKUT13738', 'Chocolate Cream Cake', 'Kue krim coklat adalah hidangan pencuci mulut yang lezat dan menggugah selera. Kue ini biasanya terdiri dari lapisan kue lembut yang diisi dengan krim atau mousse cokelat yang lembut dan kaya rasa. Bagian atasnya sering kali dilapisi dengan ganache cokelat atau hiasan-hiasan seperti serutan cokelat atau potongan buah untuk memberikan sentuhan estetika yang menarik.', 'whitecake.jpg', 120000, 0.00, 3, '1 pcs', 1, '2023-11-30 08:35:38'),
(48, 21, 'KSR210825', 'Kue Sus', '\r\nKue sus adalah kue kecil berbentuk bulat atau oval yang terbuat dari adonan pasta choux yang dipanggang hingga mengembang dan berongga di dalamnya. Kue sus ini memiliki tekstur yang ringan, renyah di luar, dan lembut di dalamnya.', 'kuesus.jpg', 2500, 0.00, 10, '1 pcs', 1, '2023-11-30 08:37:05');

